import React, { Component } from 'react';
import {dataMin, data} from '../data'

class FetchData extends Component {
    constructor(type) {
        super();
        this.state = {
            data: [],
            isLoading: false,
            type: type,
        };
}

    async componentDidMount() {
            this.setState({ isLoading: true, error: null })

            let url
            if (this.state.type === 'data-min') url = dataMin
            if (this.state.type === 'data') url = data

        fetch('url')
        .then(response => {
            return response.json();
        }).then(users => {
            let userData = users.results.map(data => {
                return(
                    <tr key={data.email}>
                        <td>{data.gender}</td>
                        <td>{data.location.state}</td>
                        <td>{data.name.first}</td>
                    </tr>
                )
            })
            this.setState({ isLoading: false })
            this.setState({data: userData})
        });

    }
    render() {
        return (
            this.state.data
        )
    }
}

export default FetchData;
